
import {Dropdown, DropdownTrigger, DropdownMenu, DropdownItem, Button} from "@nextui-org/react";
import React from "react";
export default function ShipClass_DropDown() 
{

  const iconShip = "text-m ";
  const [selectedClass, setSelectedClass] = React.useState(new Set(["Classification"]));
  const selectedValueClass = React.useMemo(
    () => Array.from(selectedClass).join(", ").replaceAll("_", " "),
    [selectedClass]
  );
  return(
    <Dropdown 
        
        radius="sm"
        className="bg-slate-900" >
      <DropdownTrigger>
        <Button 
          variant="bordered" 
          className="capitalize"
        >
          {selectedValueClass}
        </Button>
      
      </DropdownTrigger>
      
      <DropdownMenu className="bg-slate-900"
        aria-label="Rarity Sections"
        variant="flat"
        disallowEmptySelection
        selectionMode="single"
        selectedKeys={selectedClass}
        onAction={(key) => alert(key)}
        onSelectionChange={(keys) => setSelectedClass(keys as Set<string>)}
      >
        <DropdownItem 
          key="Destroyer"
          startContent={<Destroyer className={iconShip}/>}
          >Destroyer</DropdownItem>
        <DropdownItem 
          key="Heavy Cruiser" 
          startContent={<HeavyCruiser className={iconShip}/>}
          >Heavy Cruiser</DropdownItem>
        <DropdownItem 
          key="Light Cruiser" 
          startContent={<LightCruiser className={iconShip}/>}
          >Light Cruiser</DropdownItem>
        <DropdownItem 
          key="Large Cruiser" 
          startContent={<LargeCruiser className={iconShip}/>}
          >Large Cruiser</DropdownItem>
        <DropdownItem 
          key="Battleship"
          startContent={<Battleship className={iconShip}/>}
          >Battleship</DropdownItem>
        <DropdownItem 
          key="Battlecruiser" 
          startContent={<Battlecruiser className={iconShip}/>}
          >Battlecruiser</DropdownItem>
        <DropdownItem 
          key="Aviation Battleship"
          startContent={<AviationBattleship className={iconShip}/>}
          >Aviation Battleship</DropdownItem>
        <DropdownItem 
          key="Aircraft Carrier"
          startContent={<AircraftCarrier className={iconShip}/>}
          >Aircraft Carrier</DropdownItem>
        <DropdownItem 
          key="Light Aircraft Carrier"
          startContent={<LightCarrier className={iconShip}/>}
          >Light Aircraft Carrier</DropdownItem>
        <DropdownItem 
          key="Submarine"
          startContent={<Submarine className={iconShip}/>}
          >Submarine</DropdownItem>
        <DropdownItem 
          key="Submarine Carrier"
          startContent={<SubmarineCarry className={iconShip}/>}
          >Submarine Carrier</DropdownItem>
        <DropdownItem 
          key="Repair Ship"
          startContent={<RepairShip className={iconShip}/>}
          >Repair Ship</DropdownItem>
        <DropdownItem 
          key="Munition Ship"
          startContent={<MunitionShip className={iconShip}/>}
          >Repair Ship</DropdownItem>
        
      </DropdownMenu>
      
      </Dropdown>
  )
  /*<DropdownItem 
          key="Sailing Frigate">Sailing Frigate</DropdownItem> */
}
